import React from 'react';

export class FloatingMonster extends React.Component {

render() {
		return (
			<div ref={this.monsterRef} className={`floating-monster ${this.props.species}`}>
				<div className='head' />
				<div className='torso' />
				<div className='left-arm' />
				<div className='right-arm' />
			</div>
				)
}

}
